import React from "react";
import { Route, Switch } from "react-router-dom";
import Home from "./containers/Home";

export default () =>
    <Switch>
        <Route path="/" exact component={Home} />
    </Switch>;
{ /* Finally, catch all unmatched routes */ }
<Route component={NotFound} />
